import { useState, useEffect } from "react";

function Book({id}) {
    const [book, setBook] = useState([]);

    useEffect(() => {
        fetch("http://127.0.0.1:8000/api/book/")
        .then(response => response.json())
        .then(book => {
            setBook(book.map(e => e.title));
        })
        .catch(err => console.log(err))
    })

    return (
        console.log(book)
    )
}

export default Book;
